import './css/Home.css';
import Tree from '../components/Tree';
function Home() {
  return (
    <>
      <section className="columns">
        <Tree 
          name="Live Oak"
          description="Doesn't lose it's leaves"
          image="images/live-oak.jpeg"/>
        <Tree 
          name="Dogwood"
          description="Flowers in spring"
          image="images/dogwood.jpeg" />
      </section>
    </>
  );
}

export default Home;
